import React, {useState} from 'react'

const Counter = () => {
    const [num, setNum] = useState(1)

    return (
      <div className='counterContainer'>
          {num}
          <button onClick={() => {setNum(num +1)}}>
              +
          </button>
          <button onClick={() => {setNum(num -1)}}>
              -
          </button>
      </div>
    );
  }

  export default Counter;
